//import logo_main from './log_logo_new.png';
import './App.css';

import Pricing from './Pricing.js';
import LogFacts from './logs.js';
import HeaderLinks from './header.js';

function App() {
  return (
    <div className="App bg-black">
      <header style={{
        backgroundColor: '#432910',
        height: '5vh', 
        width: '100%'
      }}>
        <HeaderLinks/>
      </header>
      <div className="h-32 bg-[#f5e6d3] bg-opacity-90 p-4">

        <div style={{
          display: 'inline-block', 
          paddingTop: '1%'
        }}>
            <Pricing/>
        </div>

        <div className='bg-[#f5e6d3] bg-opacity-90 p-4 contact'>
        <h2 className="text-[#432910] text-2xl">
        Email: theclunlogcompany@gmail.com
        </h2>
        <h2 className="text-[#432910] text-2xl">
        Phone: 07815189616</h2>
        </div>


        <div style={{paddingTop: '1%', paddingBottom: '1%'}} className='bg-[#f5e6d3] bg-opacity-90 p-4'>
          <LogFacts/>
        </div>
      </div>
    </div>
  );
}

export default App;
